import React, {useState} from 'react';
import axios from 'axios';
import { makeStyles } from '@material-ui/core/styles';

import TextField from '@material-ui/core/TextField';
const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));

function Login() {
  const classes = useStyles();
  const [body, setBody] = useState({
    username: "",
    password: ""
  });
  function changeBodyInfo(e) {
    console.log(e.target.value)

     setBody({...body, [e.target.className]:e.target.value})
     console.log(body)
  }
  function loginSubmit() {
    console.log(body)
    axios.post('http://localhost:8080/users/authenticate', body, {headers: {'Content-Type': 'application/json'}})
    .then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
  }
  return(
    <div className="Login">
    <form className={classes.root} noValidate autoComplete="off">
      <TextField type="text" className = "username" value={body.username} onChange = {changeBodyInfo}/>
      <TextField label="Password" type="password" className = "password" defaultValue={body.password} onChange = {changeBodyInfo}/>
      <button className="submit" onClick = {loginSubmit}><strong>Log In</strong></button>
      <TextField
          id="standard-password-input"
          label="Password"
          type="password"
          autoComplete="current-password"
        />
   </form>
    </div>
  )
}

export default Login;
